function init(){SXE.initElementDialog("ins");if(SXE.currentAction=="update"){setFormValue("datetime",tinyMCEPopup.editor.dom.getAttrib(SXE.updateElement,"datetime"));setFormValue("cite",tinyMCEPopup.editor.dom.getAttrib(SXE.updateElement,"cite"));SXE.showRemoveButton()}}function setElementAttribs(a){setAllCommonAttribs(a);setAttrib(a,"datetime");setAttrib(a,"cite")}function insertIns(){var d=tinyMCEPopup.editor.dom.getParent(SXE.focusElement,"INS");tinyMCEPopup.execCommand("mceBeginUndoLevel");if(d==null){var c=SXE.inst.selection.getContent();if(c.length>0){insertInlineElement("INS");var a=tinymce.grep(SXE.inst.dom.select("ins"),function(e){return e.id=="#sxe_temp_ins#"});for(var b=0;b<a.length;b++){var d=a[b];setElementAttribs(d)}}}else{setElementAttribs(d)}tinyMCEPopup.editor.nodeChanged();tinyMCEPopup.execCommand("mceEndUndoLevel");tinyMCEPopup.close()}function removeIns(){SXE.removeElement("ins");tinyMCEPopup.close()}function insertInlineElement(b){var a=tinyMCEPopup.editor,c=a.dom;a.getDoc().execCommand("FontName",false,"mceinline");tinymce.each(c.select(tinymce.isWebKit?"span":"font"),function(d){if(d.style.fontFamily=="mceinline"||d.face=="mceinline"){c.replace(c.create(b),d,1)}})}tinyMCEPopup.onInit.add(init);